import React from "react";
import css from "./Task5.module.css";
import logo from "./image/twitter-Logo.png";

function Task5() {
  return (
    <div className={css.container}>
      <h3>Task 5</h3>
      <div>
        <img src={logo} alt="logo" />
      </div>
    </div>
  );
}

export default Task5;

